namespace PPSystem.Web.Controllers
{
    using System;
    using System.Collections.Generic;
    using System.Linq;
    using System.Web;
    using System.Web.Mvc;

    using AutoMapper.QueryableExtensions;

    using PPSystem.Common.Repository;
    using PPSystem.Models;
    using PPSystem.Models.Blog;
    using PPSystem.Data;
    using PPSystem.Web.ViewModels.Account;
    using PPSystem.Models.CV;
    using PPSystem.Web.ViewModels.CV;
    using PPSystem.Models.Portfolio;
    using PPSystem.Web.ViewModels.Portfolio;

    public class HomeController : Controller
    {
        private readonly IDeletableEntityRepository<ApplicationUser> users;
        private readonly IDeletableEntityRepository<Skill> skills;
        private readonly IDeletableEntityRepository<Project> projects;

        public HomeController(IDeletableEntityRepository<ApplicationUser> users,
            IDeletableEntityRepository<Skill> skills,
            IDeletableEntityRepository<Project> projects)
        {
            this.users = users;
            this.skills = skills;
            this.projects = projects;
        }

        public ActionResult Index()
        {
            var owner = this.users.All().Project().To<OwnerViewModel>().FirstOrDefault();

            if (owner == null)
            {
                return this.Redirect("/Configuration");
            }

            var topSkills = this.skills.All()
                .OrderByDescending(s => s.Completion)
                .Take(5)
                .Project().To<SkillViewModel>()
                .ToList();

            ViewBag.Skills = topSkills;

            var topProjects = this.projects.All()
                .OrderByDescending(p => p.Rating)
                .Take(5)
                .Project().To<ProjectViewModel>()
                .ToList();

            ViewBag.Projects = topProjects;

            string ownerPhotoBase64Data = @"";
            string photoDataURL= string.Format("data:image/png;base64,{0}", ownerPhotoBase64Data);
            ViewBag.Photo = photoDataURL;

            return View(owner);
        }
    }
}